DROP TABLE IF EXISTS `user_stats`;
CREATE TABLE `user_stats` (
  `email` varchar(128) COLLATE utf8mb4_general_ci NOT NULL COMMENT 'user email',
  `name` varchar(64) COLLATE utf8mb4_general_ci NOT NULL COMMENT 'user name',
  `gender` char(1) COLLATE utf8mb4_general_ci DEFAULT 'U' COMMENT 'gender: M, F, U',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'created time',
  `last_visited_at` datetime DEFAULT NULL COMMENT 'the last visit time',
  `last_watched_at` datetime DEFAULT NULL COMMENT 'the last watch time',
  `recent_watched` text COLLATE utf8mb4_general_ci COMMENT 'recent watched id list, split by comma',
  `viewed_but_not_started` text COLLATE utf8mb4_general_ci COMMENT 'viewed but not started id list, split by comma',
  `started_but_not_finished` text COLLATE utf8mb4_general_ci COMMENT 'started but not finished id list, split by comma',
  `finished` text COLLATE utf8mb4_general_ci COMMENT 'finished id list, split by comma',
  `last_email_notification` datetime DEFAULT NULL COMMENT 'the last email notfiy time',
  `last_in_app_notification` datetime DEFAULT NULL COMMENT 'the last in-app notify time',
  `last_sms_notification` datetime DEFAULT NULL COMMENT 'the last sms notify time',
  PRIMARY KEY (`email`),
  KEY `idx_created_at` (`created_at`),
  KEY `idx_last_visited_at` (`last_visited_at`),
  KEY `idx_last_watched_at` (`last_watched_at`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='User stats';

